import React from "react";

function App() {
    return  (
        <div>
            <div className="container">
                <div className="heading">
                    <span>(0)</span>0
                </div>
                <div className="operators">
                    <button>+</button>
                    <button>-</button>
                    <button>*</button>
                    <button>/ </button>
                </div>
            </div>
        </div>
    )
}


export default App;
